import React, { useEffect, useState } from 'react';

const API_URL = 'http://192.168.98.141:5001/api/recordings';

const Playback = () => {
  const [recordings, setRecordings] = useState([]);
  const [selected, setSelected] = useState(null);
  const [loading, setLoading] = useState(true);
  const [deleting, setDeleting] = useState(null);

  const fetchRecordings = async () => {
    try {
      const response = await fetch(API_URL);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setRecordings(data);
    } catch (error) {
      console.error('Error fetching recordings:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchRecordings();
  }, []);

  const deleteRecording = async (id) => {
    if (!window.confirm('Are you sure you want to delete this recording?')) {
      return;
    }

    setDeleting(id);
    try {
      console.log('Attempting to delete recording:', id);
      const response = await fetch(`${API_URL}/${id}`, {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      console.log('Delete response status:', response.status);
      console.log('Delete response ok:', response.ok);

      if (response.ok) {
        const result = await response.json();
        console.log('Delete response:', result);

        // Remove from local state
        setRecordings(recordings.filter(rec => rec._id !== id));
        if (selected === id) {
          setSelected(null);
        }
        alert('Recording deleted successfully!');
      } else {
        const errorText = await response.text();
        console.error('Delete failed:', errorText);
        alert(`Failed to delete recording: ${errorText}`);
      }
    } catch (error) {
      console.error('Error deleting recording:', error);
      alert(`Error deleting recording: ${error.message}`);
    } finally {
      setDeleting(null);
    }
  };

  return (
    <div className="max-w-2xl mx-auto mt-10 bg-white rounded-lg shadow-lg p-8">
      <h2 className="text-3xl font-bold mb-6 text-blue-700">Playback Recordings</h2>
      {loading ? (
        <div className="flex justify-center items-center h-32">
          <svg className="animate-spin h-8 w-8 text-blue-600" viewBox="0 0 24 24">
            <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4" fill="none"/>
            <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8z"/>
          </svg>
        </div>
      ) : (
        <ul className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
          {recordings.length === 0 && (
            <li className="text-gray-500">No recordings found.</li>
          )}
          {recordings.map((rec) => (
            <li
              key={rec._id}
              className="bg-white rounded-lg shadow p-4 flex flex-col justify-between border border-gray-200"
            >
              <div>
                <span className="font-semibold text-lg">{rec.filename || rec._id}</span>
                <div className="text-xs text-gray-400">
                  {rec.uploadDate ? new Date(rec.uploadDate).toLocaleString() : ''}
                </div>
                <div className="text-xs text-gray-400">
                  ID: {rec._id}
                </div>
              </div>
              <div className="flex gap-2 mt-4">
                <button
                  onClick={() => setSelected(rec._id)}
                  className="px-4 py-2 bg-blue-600 hover:bg-blue-700 text-white rounded shadow flex-1"
                >
                  Play
                </button>
                <button
                  onClick={() => deleteRecording(rec._id)}
                  disabled={deleting === rec._id}
                  className="px-3 py-2 bg-red-600 hover:bg-red-700 disabled:bg-red-400 text-white rounded shadow"
                >
                  {deleting === rec._id ? (
                    <svg className="animate-spin h-4 w-4" viewBox="0 0 24 24">
                      <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4" fill="none"/>
                      <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8z"/>
                    </svg>
                  ) : (
                    'üóëÔ∏è'
                  )}
                </button>
              </div>
            </li>
          ))}
        </ul>
      )}
      {selected && (
        <div className="mt-6">
          <h3 className="font-semibold mb-2">Now Playing</h3>
          <video
            src={`${API_URL}/${selected}`}
            controls
            autoPlay
            className="rounded border w-full h-64 bg-black shadow"
          />
        </div>
      )}
    </div>
  );
};

export default Playback;
